import React from "react";

export const MenuLateral = () => {
  return (
    <>
      <div class="container-fluid">
        <div class="row">
          <nav class="col-md-3 bg-light sidebar">
            Contenido de la barra lateral
          </nav>
          <main class="col-md-9">Contenido principal</main>
        </div>
      </div>
    </>
  );
};
